class GarageDoor:
    def __init__(self, name):
        self.name = name

    def up(self):
        print("GarageDoor Door is Up.")

    def down(self):
        print("GarageDoor Door is Down.")

    def stop(self):
        print("GarageDoor Door is Stopped.")

    def light_on(self):
        print("GarageDoor Light is On.")

    def light_off(self):
        print("GarageDoor Light is Off.")

